   Rpt2RevalueBal:number,
      /**  Reporting currency Invoice Balance at the time of revaluation  */  
   Rpt3RevalueBal:number,
      /**  Unique identifier for this row. The value is a GUID.  */  
   SysRowID:string,
   RefCode:string,
   DocToRef:boolean,
